import React from 'react'
import * as styles from './spotify.module.scss'

function Spotify() {
    return (
        <div>
            <iframe src="https://open.spotify.com/embed/playlist/3XWNoTPdXdIRapbK86Y11l" width="100%" height="380" frameBorder="0" allowtransparency="true" allow="encrypted-media"></iframe>
        </div>
    )
}

export default Spotify
